import React from 'react';
import './ContentItemPage.css';
//import {BrowserRouter as Router, Route, Switch, Link, Redirect} from 'react-router-dom';

import { Card, ListGroup, ListGroupItem, Navbar, Container, Row, Col } from 'react-bootstrap';

//Pages
//import MainPage from './pages';


function ContentItemPage() {
  return (
    <div className="ContentIteamPage">
      <header className="ContentIteamPage-header">
        <Container className="container-2">
          <Row>
          <div className="CIpage-navbar">
          <ul className="content-ul">
            <li>Home</li>
            <li>My Patients</li>
            <li>Notifications</li>
            <li>Upload Content</li>
            <li>My Content</li>
            <li>My Profile</li>
          </ul>
        </div>
          </Row>
        </Container>




      </header>
    </div>
  );
}


export default ContentItemPage;


